import React, { Component } from 'react';

import WeatherService from '../../services/weather-service';

import './form.css';

export default class Form extends Component{

	weatherService = new WeatherService();

	constructor(props){
		super(props);
		this.state = {
			value: null,
			temp: null,
			city: null,
			country: null,
			sunrise: null,
			sunset: null,
			error: null
		}

	}


	render(){
		return(
			<form onSubmit={this.props.weatherHadler}>
				<input type="text" value={this.state.name}name="city" placeholder="Введите город"/>
				<button></button>
			</form>
		)
	}
}
